import React, { useEffect, useState } from "react";
import { Box, Typography, Paper, CircularProgress, Divider } from "@mui/material";
import api from "../services/api";

const daysOfWeek = ["Senin", "Selasa", "Rabu", "Kamis", "Jumat", "Sabtu", "Minggu"];

const DeploymentCalendarPage = () => {
  const [deploymentRequests, setDeploymentRequests] = useState([]);
  const [deploymentSupports, setDeploymentSupports] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const startDate = new Date();
        const endDate = new Date();
        endDate.setDate(startDate.getDate() + 7);

        const [reqRes, supRes] = await Promise.all([
          api.get("/deployment-requests", {
            params: {
              startDate: startDate.toISOString().split("T")[0],
              endDate: endDate.toISOString().split("T")[0],
            },
          }),
          api.get("/deployment-supports", {
            params: {
              startDate: startDate.toISOString().split("T")[0],
              endDate: endDate.toISOString().split("T")[0],
            },
          }),
        ]);

        setDeploymentRequests(reqRes.data?.data || []);
        setDeploymentSupports(supRes.data?.data || []);
      } catch (err) {
        console.error("❌ Gagal memuat data:", err);
      } finally {
        setLoading(false);
      }
    };

    fetchData();
  }, []);

  const getDataForDay = (date, dataList) => {
    const targetDate = new Date(date).toISOString().split("T")[0];
    return dataList.filter((item) => item.implementDate === targetDate);
  };

  if (loading) {
    return (
      <Box
        sx={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          minHeight: "100vh",
          marginLeft: "220px",
        }}
      >
        <CircularProgress size={50} />
      </Box>
    );
  }

  return (
    <Box
      sx={{
        display: "flex",
        flexDirection: "row",
        overflowX: "auto",
        p: 2,
        gap: 2,
        marginLeft: "220px",
        minHeight: "100vh",
      }}
    >
      {daysOfWeek.map((dayName, index) => {
        const date = new Date();
        date.setDate(date.getDate() - date.getDay() + (index + 1)); // set ke minggu ini
        const formattedDate = date.toISOString().split("T")[0];

        const dayRequests = getDataForDay(formattedDate, deploymentRequests);
        const daySupports = getDataForDay(formattedDate, deploymentSupports);

        return (
          <Paper
            key={dayName}
            elevation={4}
            sx={{
              flex: "1 0 250px",
              borderRadius: 3,
              p: 2,
              minHeight: "80vh",
              display: "flex",
              flexDirection: "column",
              bgcolor: "#fafafa",
            }}
          >
            <Typography
              variant="h6"
              align="center"
              sx={{
                mb: 2,
                fontWeight: "bold",
                color: "#1976d2",
                borderBottom: "2px solid #1976d2",
                pb: 1,
              }}
            >
              {dayName}
            </Typography>

            <Box sx={{ display: "flex", flexDirection: "row", gap: 1, flex: 1 }}>
              {/* Deployment Request */}
              <Box sx={{ flex: 1 }}>
                <Typography
                  variant="subtitle2"
                  align="center"
                  sx={{ fontWeight: "bold", mb: 1 }}
                >
                  Deployment Request
                </Typography>
                <Divider />
                <Box sx={{ display: "flex", flexDirection: "column", gap: 1, mt: 1 }}>
                  {dayRequests.length > 0 ? (
                    dayRequests.map((req) => (
                      <Paper
                        key={req.id}
                        sx={{
                          p: 1,
                          borderRadius: 2,
                          bgcolor:
                            req.riskImpact === "Low"
                              ? "#A5D6A7"
                              : req.riskImpact === "Medium"
                              ? "#FFF59D"
                              : req.riskImpact === "High"
                              ? "#EF9A9A"
                              : "#E0E0E0",
                          cursor: "pointer",
                        }}
                      >
                        <Typography variant="body2" fontWeight={600}>
                          {req.title}
                        </Typography>
                        <Typography variant="caption">
                          {req.application?.name || "Unknown App"}
                        </Typography>
                      </Paper>
                    ))
                  ) : (
                    <Typography variant="body2" color="text.secondary" align="center">
                      (kosong)
                    </Typography>
                  )}
                </Box>
              </Box>

              <Divider orientation="vertical" flexItem />

              {/* Deployment Support */}
              <Box sx={{ flex: 1 }}>
                <Typography
                  variant="subtitle2"
                  align="center"
                  sx={{ fontWeight: "bold", mb: 1 }}
                >
                  Deployment Support
                </Typography>
                <Divider />
                <Box sx={{ display: "flex", flexDirection: "column", gap: 1, mt: 1 }}>
                  {daySupports.length > 0 ? (
                    daySupports.map((sup) => (
                      <Paper
                        key={sup.id}
                        sx={{
                          p: 1,
                          borderRadius: 2,
                          bgcolor:
                            sup.riskImpact === "Low"
                              ? "#C8E6C9"
                              : sup.riskImpact === "Medium"
                              ? "#FFF9C4"
                              : sup.riskImpact === "High"
                              ? "#FFCDD2"
                              : "#E0E0E0",
                          cursor: "pointer",
                        }}
                      >
                        <Typography variant="body2" fontWeight={600}>
                          {sup.title}
                        </Typography>
                        <Typography variant="caption">
                          {sup.application || "Unknown App"}
                        </Typography>
                      </Paper>
                    ))
                  ) : (
                    <Typography variant="body2" color="text.secondary" align="center">
                      (kosong)
                    </Typography>
                  )}
                </Box>
              </Box>
            </Box>
          </Paper>
        );
      })}
    </Box>
  );
};

export default DeploymentCalendarPage;
